    public void onPostRun(int statusCode, String response) {
        super.onPostRun(statusCode, response);
        if (isValidResponse())
            if (getDataArray() != null && getDataArray().length() > 0) {
                for (int i = 0; i < getDataArray().length(); i++) {
                    FavContentPageModel favContentPageModel = new FavContentPageModel(getDataArray().optJSONObject(i));
                    if (!TextUtils.isEmpty(favContentPageModel.getId()) && !MyService.isFavoriteContentDetailAvailable(favContentPageModel.getId())) {
                        MyService.addFavoriteDetailedContent(favContentPageModel);
                    }
                }
            }
    }
